	{
		negative_grad(i) = pardiso_b[i];
		 
		d(i) = result_d[i];
		 
	}
	 
	pardiso->free_numerical_factorization_memory();

	std::cout << "===========  Solving equations of linear equations : Finished !!!  ===============" << std::endl;
	 
