void SamplingOptimization::backtracking_line_search_OMP(VectorXd& x, const VectorXd& d, const VectorXd& negetive_grad, double& alpha)

{
	double h = 0.6;
	 
	double tt = -(negetive_grad.transpose() * d)(0, 0);
	cur_gradient_norm = negetive_grad.norm();
	std::cout << "**************** grad norm is:  " << cur_gradient_norm << "  ************** "<<std::endl;

	std::cout << "****************  " << "  **************  tt is: "<<tt <<" *********************" << std::endl;
	if (tt > 1e-30) {
		is_search_direction_error = true;
		std::cout << "################# appear error for search direction!  tt is:" << tt << " #####################" << std::endl;
		 

	}
	else
	{
		//std::cout << "==================== grad norm  is : " << sqrt(negetive_grad.norm()) << "  =================" << std::endl;
		//std::cout << "==================== search direction norm  is : " << sqrt(d.norm()) << "  =================" << std::endl;

	}
	//double c = 0.2;
	double c = 1e-4;
	double ex = 0.0;
	std::cout << "******************  The next line is the initial energy ***************" << std::endl;
	Energy_OMP(x, ex);
	std::cout << '\n';

	 
	double e;
	VectorXd x_new = x + alpha * d;
	std::cout << "after add alpha " << std::endl;
	Energy_OMP(x_new, e);
	std::cout << "\n";
	 
	int iter_num = 0;
	 
	while (e > ex + alpha * c * tt)
	{
		alpha = h * alpha;
		x_new = x + alpha * d;
		std::cout << "the iters is  " << iter_num++ << std::endl;
		Energy_OMP(x_new, e);
		 
	}

}

